import React, {useState} from 'react'
import { SliderData } from './SliderData'

const Slider = () => {
  return (
    <>
        {SliderData.map((slider, index) =>{
            return (
                <img src={slider.image} alt="imgs" />
            )
        })}
    </>
  )
}

export default Slider
